    return(
        <header>
            <Link to={'/'}><h1>AppFilmes</h1></Link>
            <nav>
                <Link to={'/melhores-avaliados'}>Melhores Avaliados</Link>
                <Link to={'/populares'}>Populares</Link>
                <Link to={'/proximos-lancamentos'}>Proximo Lan√ßamentos</Link>
            </nav>
        </header>
    )
}

export default Header;
